import { Button, StyleSheet, Text, View, TextInput } from 'react-native';
import { useEffect, useState } from 'react';

function AddClient(params) {

    return (
        <View>
            <TextInput
                style={styles.input}
                onChangeText={()=>params.setClientName()}
                name="clientName"
                value={params.clientName || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={params.setContactName}
                name="contactName"
                value={params.contactName || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={params.setContactPhone}
                name="contactPhone"
                value={params.contactPhone || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={params.setContactEmail}
                name="contactEmail"
                value={params.contactEmail || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={params.setContactLanguage}
                name="contactLanguage"
                value={params.contactLanguage || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setEndTime}
                name="endTime"
                value={endTime || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setBillPeriod}
                name="billPeriod"
                value={billPeriod || ""}
            />
            <Button onPress={()=>params.addClient()} title="Add Client Info"></Button>
        </View>
    )
}

export default AddClient;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    input: {
      height: 40,
      margin: 12,
      borderWidth: 1,
      padding: 10,
    },
  });
